import { Item } from "core/types"

import * as S from "./styles"

interface Props {
  item: Item
}

export function CheckItem({ item }: Props) {
  return (
    <S.Container>
      <S.Name>{item.name}</S.Name>
      <S.OwnerContainer>
        <strong>Por: </strong>
        <S.Owner value={item.owner} />
      </S.OwnerContainer>
    </S.Container>
  )
}
